import React from 'react';
import './styles.scss';

function App() {
  return (
    <div className="login">
      <p>log here</p>
      <form>
        <p>Example login screen</p>
        <p>Getting started with Green</p>
        <div className='input-container'>
          <label>Enter number below</label>
          <input
            type="email"
            placeholder="0"
          />
        </div>
      </form>
    </div>
  );
}

export default App;
